import React from 'react';
import PageLayout from '../components/PageLayout';
import InfoCard from '../components/InfoCard';
import { useNavigate } from 'react-router-dom';

const Homepage = () => {
  const navigate = useNavigate();

  const sections = [
    { title: 'Journey To Enlightenment', image: '/images/J2EPod.jpg', description: 'Experience J2E in St. Lucia.', path: '/j2e' },
    { title: 'Vibrational Intelligence', image: '/images/vibrational-intelligence.jpg', description: 'The science behind our work.', path: '/vibrational-intelligence' },
    { title: 'Podcast', image: '/images/podcast.jpg', description: 'Listen and elevate.', path: '/podcast' },
    { title: 'Chatbot - Q', image: '/images/ai-chat.jpg', description: 'Ask Q your questions.', path: '/chatbot' },
    { title: 'Search', image: '/images/search.jpg', description: 'Explore all our resources.', path: '/search' },
    { title: 'Align With Us', image: '/images/align.jpg', description: 'Partner with us.', path: '/align' }
  ];

  return (
    <PageLayout title="ðŸŒ± My Alkaline Vegan Journey" subtitle="Balance. Frequency. Healing.">
      <div className="info-grid">
        {sections.map((sec, i) => (
          <InfoCard key={i} {...sec} onClick={() => navigate(sec.path)} />
        ))}
      </div>
    </PageLayout>
  );
};

export default Homepage;
